import React from 'react';
import styles from "./NavBar.module.css"

const NavBar = () => {
    return (
        <header className={styles.navbar}>
            <nav>
                <ul>
                    <li>
                        Main
                    </li>
                    <li>
                        Searcg
                    </li>
                    <li>
                        Paradox of Choice.
                    </li>
                    <li>
                        You finally decided.
                    </li>
                </ul>
            </nav>
        </header>
    );
};

export default NavBar;
